    body:
      encoding: UTF-8
      string: "@article{E C Morris_1993,\r\ndoi = {10.1088/0026-1394/29/6/001},\r\nurl
        = {https://dx.doi.org/10.1088/0026-1394/29/6/001},\r\nyear = {1993},\r\nmonth
        = {jan},\r\npublisher = {},\r\nvolume = {29},\r\nnumber = {6},\r\npages =
        {373},\r\nauthor = {E C Morris},\r\ntitle = {Decade Designs for Weighings
        of Non-uniform Variance},\r\njournal = {Metrologia},\r\nabstract = {The selection
        of an efficient weighing design is a common problem in mass metrology. The
        calibration of a set of nominally equal masses in terms of one or more reference
        masses of the same value does not normally present any difficulty, but designs
        for extending the calibration of a kilogram mass to multiples and submultiples
        of the unit are more complex. A selection rule that is very widely used is
        that the design matrix be orthogonal. However, orthogonality is advantageous
        only when all the weighings in the design have the same variance. In accurate
        work this is generally not the case, as the variance of balances is load-dependent
        and furthermore it is often necessary to use more than one balance. Designs
        which make better use of weighings of non-uniform variance have been studied,
        and a practical approach to the construction of such designs is given.}\r\n}\r\n"
